import React from 'react';
import './NavigationBar.css';
import logo from '../assets/logo.svg';

const NavigationBar = () => {
  return (
    <nav className="navigation-bar">
      <div className="nav-container">
        <div className="logo-container">
          <img src={logo} alt="Idea Ascend Logo" className="nav-logo" />
          <span className="logo-text">Idea Ascend</span>
        </div>

        <div className="nav-links">
          <a href="#" className="nav-link active">Home</a>
          <a href="#" className="nav-link">About Us</a>
          <a href="#" className="nav-link">Founder's Teams</a>
          <a href="#" className="nav-link">Mentor</a>
          <a href="#" className="nav-link">Investor</a>
        </div>

        <button className="chatbot-button">CHATBOT</button>
      </div>
    </nav>
  );
};

export default NavigationBar;
